div.script:
w49(document).ready(function() {
	w49("#w49-header-navigation LI").mouseenter(function() {
		w49(this).find(".global-nav-sub").stop(true,true).show();
	}).mouseleave(function() {
		w49(this).find(".global-nav-sub").stop(true,true).hide();
	});
	
	w49(".brand-thumbs-container .more").click(function() {
		var speed = 300;
		var brandsPanels = w49(".brand-thumbs-container UL").length;
		var lastPanel = "brands-" + brandsPanels;
		
		var currentPanel = w49(".brand-thumbs-container UL:visible");
		
		w49(currentPanel).fadeOut(speed, function() {
		
			if ( w49(currentPanel).attr('id') != lastPanel) {
				w49(currentPanel).next().fadeIn(speed);
			} else {
				w49("#brands-1").fadeIn(speed);
			}
		
		});
		
		
		
		return false;
	});
});

